def aa(t):
    w = []
    y = 0
    t_length = len(t)
    while y < t_length:
        r = ord(t[y:y+1])
        y += 1
        if 37 == r:
            w.append(int(t[y:2], 16))
            y += 2
        else:
            w.append(r)
    return w

